window.bookSummaryJSON = "<p>The second chapter in the life of Anne Shirley. This book follows Anne from the age of 16 to 18, during the two years that she teaches at Avonlea school. It includes many of the characters from Anne of Green Gables, as well as new ones like Mr. Harrison, Miss Lavendar Lewis, Paul Irving, and the twins Dora and Davy.</p>"; 
